import React from 'react';
import logo from '../img/lgo.png'
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import { faFacebook,faInstagram,faYoutube } from '@fortawesome/free-brands-svg-icons';
// import { faPhoneAlt, faArrowCircleDown} from '@fortawesome/free-solid-svg-icons'
import { Navbar, Nav, } from 'react-bootstrap';
const Navigation = () => {
  return (
    <div>
      <Navbar collapseOnSelect expand="lg" bg="light" variant="dark">
        <Navbar.Brand href="#home"><img src={logo} className="logo" alt="logo" /></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto menuitem">
            <Nav.Link href="#home" id ="home">Home</Nav.Link>
            <Nav.Link href="#service" id ="home" >Service</Nav.Link>
            <Nav.Link href="skill" id ="home" >Skill</Nav.Link>
            <Nav.Link href="about" id ="home" >About</Nav.Link>
            <Nav.Link href="contact" id ="home" >Contact</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  )
}
export default Navigation;
